function AddLiquidityPage() {
  const openModal = useOpenModal();

  const query = useQuery();
  const from = query.get('from');
  const to = query.get('to');

  const { tokens } = useAvailableTokens();

  const [fromToken, setFromToken] = useState<Token | null>(null);
  const [toToken, setToToken] = useState<Token | null>(null);

  const [minPrice, setMinPrice] = useState<null | number>(350);
  const [maxPrice, setMaxPrice] = useState<null | number>(1200);

  const [isInitialized, setIsInitialized] = useState(false);

  useEffect(() => {
    setIsInitialized(toToken?.symbol !== 'TUSD');
  }, [fromToken, toToken]);

  useEffect(() => {
    if (from) {
      setFromToken(tokens.find((t) => t.symbol === from) || null);
    }

    if (to) {
      setToToken(tokens.find((t) => t.symbol === to) || null);
    }
  }, [from, to]);

  const [fee, setFee] = useState(0.5);

  return (
    <div className="page add-liquidity-page">
      <div className="page-head page-head--subpage">
        <Link to="/liquidity" className="page-back">
          <PageBackIcon/>
          Back
        </Link>
        <h1 className="page-title">
          Add liquidity
        </h1>
        <div className="page-toolbar">
          <button className="page-toolbar__icon-button">
            <AddLiquidityPageHistoryIcon/>
          </button>
          <button className="page-toolbar__icon-button">
            <AddLiquidityPagePreferencesIcon/>
          </button>
        </div>
      </div>

      <div className="page-content page-content-liquidity">
        {
          fromToken && toToken && !isInitialized ? (
            <div className="page-content-liquidity__info">
              This pool must be initialized before you can add liquidity. To initialize, select a
              starting price for the pool. Then, enter your liquidity price range and deposit
              amount.
              Gas fees will be higher than usual due to the initialization transaction.
            </div>
          ) : null
        }
        <div className="page-blocks">
          <div className="page-blocks__col">
            <div className="page-block">
              <div className="page-block__title">
                Deposit Amounts
              </div>

              <div className="page-block__content">
                <TokenAmountInput
                  token={fromToken}
                  onChangeToken={setFromToken}
                />
                <TokenAmountInput
                  token={toToken}
                  onChangeToken={setToToken}
                />
              </div>
            </div>
            <div className="page-block">
              <div className="page-block__title">
                Select fee
              </div>

              <div className="page-block__content">
                <FeeCard
                  disabled={!fromToken || !toToken}
                  amount={fee}
                  onClick={() => openModal(({ closeModal }) => (
                    <SelectFeeModal
                      active={fee}
                      closeModal={closeModal}
                      onChange={(amount) => setFee(amount)}
                    />
                  ))}
                />
              </div>
            </div>
          </div>
          {!fromToken || !toToken ? (
            <div className="page-blocks__col page-blocks__col--duck">
              <DuckArt/>
              <span>
                Select tokens for a pair to add liquidity
              </span>
            </div>
          ) : (
            <div className="page-blocks__col">
              <div className="page-block">
                <div className="page-block__title">
                  {isInitialized ? 'Select Price Range' : 'Set Start Price'}
                </div>

                {isInitialized ? (
                  <div className="page-block__content page-block__content--range">
                    <InputRange
                      step={1}
                      maxValue={1500}
                      minValue={0}
                      value={{
                        min: minPrice ?? 0,
                        max: maxPrice ?? 0,
                      }}
                      onChange={(value) => {
                        if (typeof value === 'object') {
                          setMinPrice(value.min);
                          setMaxPrice(value.max);
                        }
                      }}
                    />
                  </div>
                ) : (
                  <div className="page-block__content page-block__content--range">
                    <div className="price-input">
                      <input type="number" placeholder="0.000"/>
                      <div className="price-input__info">
                        0 TON per ETH
                      </div>
                    </div>
                  </div>
                )}
              </div>
              <div className="page-block liquidity-prices">
                <div
                  className={['liquidity-price', !isInitialized ? 'liquidity-price--disabled' : ''].join(' ')}
                >
                  <div className="liquidity-price__title">
                    Min Price
                  </div>

                  <div className="liquidity-price-card">
                    <button
                      className="liquidity-price-card__button"
                      onClick={() => setMinPrice((minPrice || 1) - 1)}
                    >
                      <MinusIcon/>
                    </button>
                    <div className="liquidity-price-card__amount">
                      <input
                        value={minPrice ?? ''}
                        onChange={(event) => {
                          const { value } = event.currentTarget;

                          if (!value.length) {
                            setMinPrice(null);
                          } else {
                            setMinPrice(Number(value));
                          }
                        }}
                        type="number"
                      />
                    </div>
                    <button
                      className="liquidity-price-card__button"
                      onClick={() => setMinPrice((minPrice || 0) + 1)}
                    >
                      <PlusIcon/>
                    </button>
                  </div>
                </div>
                <div
                  className={['liquidity-price', !isInitialized ? 'liquidity-price--disabled' : ''].join(' ')}
                >
                  <div className="liquidity-price__title">
                    Max Price
                  </div>

                  <div className="liquidity-price-card">
                    <button
                      className="liquidity-price-card__button"
                      onClick={() => setMaxPrice((maxPrice || 1) - 1)}
                    >
                      <MinusIcon/>
                    </button>
                    <div className="liquidity-price-card__amount">
                      <input
                        value={maxPrice ?? ''}
                        onChange={(event) => {
                          const { value } = event.currentTarget;

                          if (!value.length) {
                            setMaxPrice(null);
                          } else {
                            setMaxPrice(Number(value));
                          }
                        }}
                        type="number"
                      />
                    </div>
                    <button
                      className="liquidity-price-card__button"
                      onClick={() => setMaxPrice((maxPrice || 0) + 1)}
                    >
                      <PlusIcon/>
                    </button>
                  </div>
                </div>
              </div>
              <div className="page-block">
                <div className="liquidity-summary-card">
                  <div className="liquidity-summary-card-cols">
                    <div className="liquidity-summary-card-col">
                      <div className="liquidity-summary-card-col__value">0.00014</div>
                      <div className="liquidity-summary-card-col__name">ETH per TON</div>
                    </div>
                    <div className="liquidity-summary-card-col">
                      <div className="liquidity-summary-card-col__value">756</div>
                      <div className="liquidity-summary-card-col__name">TON per ETH</div>
                    </div>
                    <div className="liquidity-summary-card-col">
                      <div className="liquidity-summary-card-col__value">0.00009541%</div>
                      <div className="liquidity-summary-card-col__name">Share of Pool</div>
                    </div>
                  </div>

                  <Button form full>
                    Supply
                  </Button>
                </div>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default AddLiquidityPage;
